// 
function uuidv4() {
	return ([1e7] + -1e3 + -4e3 + -8e3 + -1e11).replace(/[018]/g, c => (c ^ crypto.getRandomValues(new Uint8Array(1))[0] & 15 >> c / 4).toString(16));
}

// 
function createCookie(name, value, days) {
	var expires;
	
	if (days) {
		var date = new Date();
		date.setTime(date.getTime() + days * 24 * 60 * 60 * 1000);
		expires = "; expires=" + date.toGMTString();
	} else {
		expires = "";
	}
	
	document.cookie = name + "=" + value + expires + "; path=/;";
}

// 
function readCookie(name) {
	var nameEQ = name + "=";
	var ca = document.cookie.split(';');
	
	for (var i = 0; i < ca.length; i++) {
		var c = ca[i];
		
		while (c.charAt(0) === ' ') {
			c = c.substring(1, c.length);
		}
		
		if (c.indexOf(nameEQ) === 0) {
			return c.substring(nameEQ.length, c.length);
		}
	}
	
	return null;
}

// 
function eraseCookie(name) {
	createCookie(name, "", -1);
}

// ,       
function sendCookies(eventId) {
	if (readCookie('rte.uid') === null) {
		createCookie('rte.uid', uuidv4(), 30);
		createCookie('rte.refererUrl', window.location.href, 30);
	}
	
	let cookieUID = readCookie('rte.uid');
	let cookieURL = readCookie('rte.refererUrl');
	
	let link
	if (formData.userHash) {
		link = `${backendApi}/api/v1/events/${eventId}/form?uid=${cookieUID}&user_hash=${formData.userHash}&url=${cookieURL}&referrer=${document.referrer || 'noref'}`
	} else {
		link = `${backendApi}/api/v1/events/${eventId}/form?uid=${cookieUID}&url=${cookieURL}&referrer=${document.referrer || 'noref'}`
	}
	return fetch(link).then(response => {
		return response.json().then(data => {
			if (response.ok) {
				return data;
			} else {
				return Promise.reject({
					status: response.status,
					data
				});
			}
		});
	});
}

sendCookies(formData.event.id);

