	handleSingleSchemaOrder() {
		const chosenTickets = this.chosenTickets;
		return function (schema) {
			chosenTickets.forEach((ticketSchema, i) => {
				if (schema.title === ticketSchema.title) {
					alert(ticketSchema.title + " " + ticketSchema.value);
				}
			});
		};
	}
